mapper.select:

    select

    from ftu_jl_gjts


            and id=#{id,jdbcType=VARCHAR}


            and tsid=#{tsid,jdbcType=VARCHAR}


            and ssqy=#{ssqy,jdbcType=VARCHAR}


            and csx=#{csx,jdbcType=VARCHAR}


            and dz=#{dz,jdbcType=VARCHAR}


            and g1dz=#{g1dz,jdbcType=DECIMAL}


            and g1sjtd1=#{g1sjtd1,jdbcType=DECIMAL}


            and g1sjtd2=#{g1sjtd2,jdbcType=DECIMAL}


            and g2dz=#{g2dz,jdbcType=DECIMAL}


            and g2sjtd1=#{g2sjtd1,jdbcType=DECIMAL}


            and g2sjtd2=#{g2sjtd2,jdbcType=DECIMAL}


            and lx1dz=#{lx1dz,jdbcType=DECIMAL}


            and lx1sjtd1=#{lx1sjtd1,jdbcType=DECIMAL}


            and lx1sjtd2=#{lx1sjtd2,jdbcType=DECIMAL}


            and lx2dz=#{lx2dz,jdbcType=DECIMAL}


            and lx2sjtd1=#{lx2sjtd1,jdbcType=DECIMAL}


            and lx2sjtd2=#{lx2sjtd2,jdbcType=DECIMAL}


            and czr=#{czr,jdbcType=VARCHAR}


            and czsj=#{czsj,jdbcType=TIMESTAMP}


            and beizhu=#{beizhu,jdbcType=VARCHAR}


order by csx

